script: |
  super -f text -I q10387.spq | sort > q10387.out

inputs:
  - name: q10387.spq
    data: |
      SELECT - - 33 / ( + - 45 ) + 16 AS col0 FROM tab0 (FORMAT parquet) cor0 WHERE + 42 + - - col2 + - 16 * + 64 * + - col0 * col2 IS NOT NULL;
  - name: tab0

outputs:
  - name: q10387.out
    data: |
      16
      16
      16
